import React from 'react';
import { useCart } from '../contexts/CartContext';
import { useNavigate } from 'react-router-dom';

const Checkout = () => {
  const { cartItems, getTotalPrice, clearCart } = useCart(); // Lấy dữ liệu từ CartContext
  const navigate = useNavigate();

  // Hàm xử lý khi thanh toán
  const handleCheckout = (event) => {
    event.preventDefault();
    // Giả lập xử lý thanh toán
    alert('Thanh toán thành công!');
    clearCart(); // Làm rỗng giỏ hàng sau khi thanh toán thành công
    navigate('/'); // Quay lại trang chủ sau khi thanh toán
  };

  return (
    <div className="checkout-page">
      <h2 className="text-center mb-5">Thanh Toán</h2>
      <div className="container">
        {/* Kiểm tra giỏ hàng */}
        {cartItems.length > 0 ? (
          <div className="row">
            {/* Hiển thị danh sách sản phẩm */}
            <div className="col-md-8">
              <div className="card">
                <div className="card-body">
                  <h5 className="card-title">Thông tin giỏ hàng</h5>
                  <ul className="list-group">
                    {cartItems.map((item) => (
                      <li className="list-group-item d-flex justify-content-between align-items-center" key={item.id}>
                        <span>{item.name} x {item.quantity}</span>
                        <span>{(item.price * item.quantity).toLocaleString()} Đ</span>
                      </li>
                    ))}
                  </ul>
                </div>
              </div>
            </div>

            {/* Hiển thị thông tin thanh toán */}
            <div className="col-md-4">
              <div className="card">
                <div className="card-body">
                  <h5 className="card-title">Tổng tiền</h5>
                  <p className="card-text">
                    Tổng cộng: <strong>{getTotalPrice().toLocaleString()} Đ</strong>
                  </p>

                  {/* Form thông tin người nhận */}
                  <h5 className="card-title">Thông tin người nhận</h5>
                  <form onSubmit={handleCheckout}>
                    <div className="mb-3">
                      <label htmlFor="name" className="form-label">Họ và tên</label>
                      <input type="text" className="form-control" id="name" required />
                    </div>
                    <div className="mb-3">
                      <label htmlFor="address" className="form-label">Địa chỉ giao hàng</label>
                      <input type="text" className="form-control" id="address" required />
                    </div>
                    <div className="mb-3">
                      <label htmlFor="phone" className="form-label">Số điện thoại</label>
                      <input type="tel" className="form-control" id="phone" required />
                    </div>

                    {/* Nút xác nhận thanh toán */}
                    <button type="submit" className="btn btn-success btn-lg mt-3 w-100">
                      Xác nhận thanh toán
                    </button>
                  </form>
                </div>
              </div>
            </div>
          </div>
        ) : (
          <p className="text-center">Giỏ hàng của bạn đang trống.</p>
        )}
      </div>
    </div>
  );
};

export default Checkout;
